import React from "react";
import "./style.css";
export default class Logs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      continents: [],
    };
  }
  componentDidMount() {
    fetch("http://localhost:4000/api/logs")
      .then((response) => {
        return response.json();
      })
      .then((json) =>
        this.setState({
          data: json.logs,
          continents: json.continents,
        })
      );
  }
  render() {
    return <div>{this.state.data}</div>;
  }
}
